import { useState } from 'react';

import { Section, Container } from '../../Layout';
import { Header } from '../../Header';
import { List, ListItem} from '../../List';

import logo82Fm from '../../../assets/images/logo87Fm.svg';

export function Solucoes()
{
    let [solucaoAtual, definirSolucao] = useState(1);

    let solucao = null;

    switch (solucaoAtual) {
        case 0:
            solucao = 'GetzFood';
            break;

        case 1:
            solucao = 'Getz Gestor';
            break;

        default:
            break;
    }

    return(
        <Section id='nossas_solucoes'>
            <Container>
                <Header>
                    <h2>Nossas soluções.</h2>
                    <p>Conheça o que a Hexalab já desenvolveu.</p>
                </Header>

                <List>
                    <ListItem>
                        <button>

                        </button>
                    </ListItem>
                </List>

                <div className='solucao'>
                    {solucao}
                </div>
            </Container>
        </Section>
    );
}
